val categoricalCols = Seq("workclass", "education", "marital_status", "occupation", "relationship", "race", "sex", "native_country")
val numericCols = Seq("age", "fnlwgt", "education_num", "capital_gain", "capital_loss", "hours_per_week")

import org.apache.spark.ml.feature.{OneHotEncoder, StringIndexer, VectorAssembler}
import org.apache.spark.ml.{Pipeline, PipelineModel}

val stages = categoricalCols.flatMap{w =>
    val stringIndexer = new StringIndexer()
        .setInputCol(w)
        .setOutputCol(w+"Index")
    val oneHotEncoder = new OneHotEncoder()
        .setInputCol(stringIndexer.getOutputCol)
        .setOutputCol(stringIndexer.getInputCol + "ClassVec")
    Seq(stringIndexer, oneHotEncoder)// ++ Seq(label_stringIdx)
}

val label_stringIdx = new StringIndexer()
    .setInputCol("income")
    .setOutputCol("label")
val assemblerStage = new VectorAssembler()
    .setInputCols(categoricalCols.map(w => w +"ClassVec").toArray)
    .setOutputCol("features")

val  finalStages = Seq(label_stringIdx) ++ stages ++ Seq(assemblerStage)

val pipeline = new Pipeline()
  .setStages(finalStages.toArray)
pipeline.fit(dataset).transform(dataset).show()
